import './App.css';
import EncounterMember from './EnounterMember.js';

function App() {

  let testMember = new EncounterMember("Test Member", 16, [], [], []);

  return (
    <div className="App">
      <p>
        name: {testMember.name}, initiative: {testMember.initiative}!
      </p>
    </div>
  );
}

export default App;
